description:
Like TEMPLATE? The creative team is trying to fund a print version of the first story arc to release in stores after it wraps in November and needs YOUR help! Check out Kickstarter campaign to do just that, and pledge to get some cool stuff! 

 &lt;a href=&quot;
http://www.kickstarter.com/projects/qmiles/template-volume-1&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://www.kickstarter.com/projects/qmiles/template-volume-1&lt;/a&gt;


We want to keep doing future volumes of TEMPLATE for free the way we have, and contributing to this campaign is one way to let us know you support what we're doing. 

Thanks!
QAM Comics
